<strong>Star Cast</strong>:

<strong>Salman Khan</strong>, <strong>Katrina Kaif</strong>,<strong> Paresh Rawal</strong>,<strong> Sajjad Delafrooz</strong>,<strong>Â  Kumud Mishra</strong>,<strong> Angad Bedi</strong>,<strong> Girish Karnad</strong>

<strong>Director</strong>: <span style="text-decoration: underline;">Ali Abbas Zafar</span>

<img class="aligncenter wp-image-519" src="http://wikiceleb.com/wp-content/uploads/2017/12/1-8-300x178.jpg" alt="" width="538" height="319" />

<strong>Good thing in Movie</strong>:
Despite a Salman Khan film when a storyteller director Ali Abbas Zafar puts story as his priority, thatâ€™s a major good thing about the movie. Once again Salman khan proving himself why heâ€™s termed as a Superstar or Tiger or Blockbuster Khan.
<p style="text-align: justify;"><strong>The bad thing in Movie</strong>:</p>
<p style="text-align: justify;">There are some loopholes in the movie but due to the grandness of the Salman Khan breathtaking action scene, that can be totally ignored.</p>
<strong>Watch or Not?</strong>

This movie will be the Christmas gift for Salman fan and even if you never got enjoyed by Salman Khan Movie go and enjoy the movie.
<p style="text-align: justify;"><strong>Plot</strong>:</p>
<p style="text-align: justify;">Tiger Zinda Hai starts with a pretty intense backdrop where a bus full of 25 Indian nurses and 15 Pakistani nurses gets kidnapped by a terrorist group called ISC in Iraq. The RAW head Shenoy and Official in India agreed to appoint Tiger for the Mission to rescue the nurses. With the help of an agent, RAW finds the location of Tiger whoâ€™s in exile since past 8 years. Backing his country, Tiger decides to work on the new mission and he builds up his own team having a sniper from Indian Army,Â  a genius technician and a bomb diffuser. Rest of the story in the movie uncovers the stages of this mission.</p>
