</script>
<img class="aligncenter wp-image-520" src="http://wikiceleb.com/wp-content/uploads/2017/12/2-8-300x200.jpg" alt="" width="548" height="365" />

<strong>Script</strong>:
<p style="text-align: justify;">Tiger Zinda Hai is not a perfect film but itâ€™s superior to most of what weâ€™ve seen in Bollywood. Despite the presence of Salman Khan in movie Ali Abbas Zafar is the Captain of this movie.He has scripted the movie as a gripping spying thriller that makes Ali the winner for this movie. The story of the movie keeps you clandestine amidst the heroism or machoism of Tiger or Salman Khan.</p>
<p style="text-align: justify;"><strong>Star Performance</strong>:
Salman Khan did what he does the best and that entertains everyone. Salman Khan is returning to his own style and the whistles in his entry scene and his breathtaking action scenes still reverberate in my head. The best thing is that he surrenders himself completely to captain Ali Abbas Zafar and for the same reason, Sultan was a blockbuster and hope Tiger Zinda Hai achieves more success.
Katrina Kaif is brilliant in this movie. She has turned into a fighter for this movie and working amazingly well with her expressions, she managed to shut some of the critics with this one.
Angad Bedi plays the role of bomb diffuser perfectly and Kumud Mishra and Girish Karnad are also justifiable in their roles. Paresh Rawal manages to make you laugh in this intense scene. The main antagonist of the film Sajjad Delafrooz is just about above average.</p>
<img class="aligncenter wp-image-521" src="http://wikiceleb.com/wp-content/uploads/2017/12/3-2-300x151.png" alt="" width="555" height="279" />

<strong>Final word</strong>:

Tiger Zinda Hai is surely the most entertaining and masala film of the year and this will be the treat of Christmas 2017 for Salman fan. Director Ali Abbas Zafar tries to infuse patriotism in the story of the movie.

<a href="http://www.wikiceleb.com">www.wikiceleb.com</a>";s:10:"post_title";s:79:"Tiger Zinda Hai Movie Review: Blockbuster Salman Khan and Gorgeous Katrina Kaif";s:12:"post_excerpt";s:0:"";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:4:"open";s:11:"ping_status";s:4:"open";s:13:"post_password";s:0:"";s:9:"post_name";s:74:"tiger-zinda-hai-movie-review-blockbuster-salman-khan-gorgeous-katrina-kaif";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2017-12-22 23:07:48";s:17:"post_modified_gmt";s:19:"2017-12-22 17:22:48";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";s:1:"0";s:4:"guid";s:27:"http://wikiceleb.com/?p=518";s:10:"menu_order";s:1:"0";s:9:"post_type";s:4:"post";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";}i:4;O:8:"stdClass":23:{s:2:"ID";s:3:"543";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-12-23 15:48:39";s:13:"post_date_gmt";s:19:"2017-12-23 10:03:39";s:12:"post_content";s:4102:"<p style="text-align: justify;">The West African nation that has appeared 5 FIFA World Cups with the official FIFA ranking of 50 is Nigeria. This western African nation has not managed to win any of the FIFA World Cup yet neither they have managed to appear in any semifinals and finals round. The first appearance of Nigeria in FIFA World Cup was in 1994 when United State was hosting the FIFA World Cup. Since then Nigeria has managed to Qualify for the FIFA World Cup except in 2006. In the history of FIFA World Cup, Nigeria has played altogether of 18 games with 5 wins 3 draws and 10 losses. The best ever FIFA World Cup performance of Nigeria was against Bulgaria in 1994 where Nigeria managed to win the game with the Final score of 3-0.</p>
<img class="aligncenter wp-image-544" src="http://wikiceleb.com/wp-content/uploads/2017/12/NIgeria-300x167.jpg" alt="" width="541" height="301" />

<strong><u>World Cup Qualifier Africa</u></strong>
<p style="text-align: justify;">All the 53 members of the association will take part in the competition which goes for three rounds and at the end of the third round, we will have 5 African countries to book their seat on FIFA World Cup 2018.For the first round 26 lower FIFA Coca-cola ranking teams are divided into two groups and the 13 winners of this round will compete with the13 highest ranking teams from Africa and rest of the 14 teams will join these teams on round two and the 20 winners from round two advances to third round where five groups of four teams each will compete and the leader of each group qualifies for the World Cup.</p>
<p style="text-align: justify;">Nigeria was leading the group B until the last round of the Competition in World Cup qualifier Africa. During the termination of the World Cup qualifier, Africa Nigeria won 14 points that made Nigeria a group leader in Group B with 6 games played total Nigeria managed to win 4 of them with 2 draws.</p>
<img class="aligncenter wp-image-545" src="http://wikiceleb.com/wp-content/uploads/2017/12/nigeria-celebration-300x193.jpg" alt="" width="535" height="344" />

<strong><u>FIFA World Cup 2018 Group D</u></strong>

The final draw of FIFA World Cup 2018 has placed Nigeria in Group D where Nigeria has to play against <a href="http://wikiceleb.com/iceland-road-russia-fifa-world-cup-2018/">Iceland</a><a href="http://wikiceleb.com/croatia-road-russia-fifa-world-cup-2018/"> Croatia</a> and <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/">Argentina</a> and qualify for the Knockout stage into the round of Sixteenâ€™s.

