<strong><u>World Cup Qualifier Europe</u></strong>
<p style="text-align: justify;">The World Cup qualifier in Europe selects 14 countries for the FIFA World Cup and for 2018 FIFA World Cup, Russia qualifies for being a host country. 52 countries who are the members of FIFA from Europe go for the preliminary competition where those 5 countries were divided into 9 groups in which 7 groups contain 6 teams and rest of the two groups contain only 5 teams. <a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">England</a>, <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a>, <a href="http://wikiceleb.com/germany-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Germany</a>, Italy, Netherlands, and <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a> are placed in a group containing 6 teams. Winners from each group qualify automatically and the eight best runners-up go for the playoffs from which 4 teams are selected. Thus, in this way, the Europe qualifier selects 14 nations for the FIFA World Cup.</p>
<p style="text-align: justify;">Croatia finished second in group I with 6 wins in a total of 10 games and advanced to the second round. Croatia faced Greece in the second round where Croatia won 4-1 against Greece in the home of Croatia and Croatia played a draw against Greece in away match. Captain of the Croatianâ€™s team Luka Modric scored penalty just in 13 minutes, and Nikola Kalinic, Ivan Perisic, Andrej Kramaric scored the net to seal the victory against Greece.</p>
<img class="aligncenter wp-image-555" src="http://wikiceleb.com/wp-content/uploads/2017/12/celebration-of-cortia-300x188.jpg" alt="" width="535" height="335" />

<strong><u>FIFA World Cup 2018 Group D</u></strong>

The final draw of FIFA World Cup 2018 has placed Croatia in Group D where Croatia has to play against <a href="http://wikiceleb.com/argentina-russia-world-cup-2018/" target="_blank" rel="noopener">Argentina</a>, <a href="http://wikiceleb.com/nigeria-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Nigeria</a>, and <a href="http://wikiceleb.com/iceland-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Iceland</a> and qualify for the knockout stage into the round of sixteenâ€™s.

